A <a href="http://sw.opencyc.org/concept/Mx4rvViBApwpEbGdrcN5Y29ycA" class="cyc_term">BinaryPredicate</a> that relates a specialization of <a href="http://sw.opencyc.org/concept/Mx4rvViADZwpEbGdrcN5Y29ycA" class="cyc_term">Event</a> to an instance of <a href="http://sw.opencyc.org/concept/Mx4rvViAC5wpEbGdrcN5Y29ycA" class="cyc_term">EmotionalQuantityType</a>.  <code>(<a href="http://sw.opencyc.org/concept/Mx4rqrgXVvCHQdiaucBw2mcDkA" class="cyc_term">eventTypeFostersFeelingType</a> <b>EVT-TYPE</b> <b>FEEL-TYPE</b>)</code> means that instances of <code><b>EVT-TYPE</b></code> often cause or result in instances of <code><b>FEEL-TYPE</b></code>.  (This is deliberately a vague notion.)  For example:
<pre>
(<a href="http://sw.opencyc.org/concept/Mx4rqrgXVvCHQdiaucBw2mcDkA" class="cyc_term">eventTypeFostersFeelingType</a> <a href="http://sw.opencyc.org/concept/Mx4rvVjWuJwpEbGdrcN5Y29ycA" class="cyc_term">WatchingTelevision</a> <a href="http://sw.opencyc.org/concept/Mx4rvVifGZwpEbGdrcN5Y29ycA" class="cyc_term">Entertained_Emotion</a>);
(<a href="http://sw.opencyc.org/concept/Mx4rqrgXVvCHQdiaucBw2mcDkA" class="cyc_term">eventTypeFostersFeelingType</a> <a href="http://sw.opencyc.org/concept/Mx4rvVjL8pwpEbGdrcN5Y29ycA" class="cyc_term">SexualCopulation</a> <a href="http://sw.opencyc.org/concept/Mx4rvVkL9ZwpEbGdrcN5Y29ycA" class="cyc_term">Pleasure_Feeling</a>);
(<a href="http://sw.opencyc.org/concept/Mx4rqrgXVvCHQdiaucBw2mcDkA" class="cyc_term">eventTypeFostersFeelingType</a> <a href="http://sw.opencyc.org/concept/Mx4rvVi-35wpEbGdrcN5Y29ycA" class="cyc_term">Resting_Relaxing</a> <a href="http://sw.opencyc.org/concept/Mx4rwQBz4pwpEbGdrcN5Y29ycA" class="cyc_term">Relaxation</a>).
</pre>
